// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { commonGlobalNavigationRenderFunction } from 'js/CommonGlobalNavigationService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/CommonGlobalNavigationService', () => import('js/CommonGlobalNavigationService'));
registerDynImportEntry('js/viewModelObjectService', () => import('js/viewModelObjectService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "data": {
        "sideNavData": {
            "slide": "FLOAT",
            "direction": "LEFT_TO_RIGHT",
            "animation": "true",
            "width": "STANDARD",
            "height": "FULL",
            "isPinnable": true
        }
    },
    "actions": {
        "render": {
            "method": "commonGlobalNavigationRenderFunction",
            "deps": "js/CommonGlobalNavigationService"
        },
        "updateUserAndUserSessionOnContext": {
            "actionType": "batchJob",
            "steps": [
                {
                    "action": "updateUserOnContext"
                },
                {
                    "action": "updateUserSessionOnContext"
                }
            ]
        },
        "updateUserOnContext": {
            "actionType": "JSFunction",
            "method": "createViewModelObject",
            "inputData": {
                "user": "{{ctx.user}}"
            },
            "outputData": {
                "ctx.user": ""
            },
            "deps": "js/viewModelObjectService"
        },
        "updateUserSessionOnContext": {
            "actionType": "JSFunction",
            "method": "createViewModelObject",
            "inputData": {
                "userSession": "{{ctx.userSession.uid}}"
            },
            "outputData": {
                "ctx.userSession": ""
            },
            "deps": "js/viewModelObjectService"
        },
        "commonGlobalNavigationMountAction": {
            "actionType": "Event",
            "method": "Event",
            "inputData": {
                "events": [
                    {
                        "name": "commonGlobalNavigationMountActionEvent"
                    }
                ]
            }
        }
    },
    "dataProviders": {},
    "functions": {},
    "onEvent": [
        {
            "eventId": "commonGlobalNavigationMountActionEvent",
            "action": "updateUserAndUserSessionOnContext",
            "condition": "conditions.hasTcSessionData"
        },
        {
            "eventId": "cdm.updated",
            "action": "updateUserSessionOnContext",
            "condition": "conditions.isSessionVmoUpdated"
        }
    ],
    "i18n": {
        "PRIMARY_NAVIGATION": [
            "BaseMessages"
        ]
    },
    "messages": {},
    "conditions": {
        "hasTcSessionData": {
            "expression": "ctx.tcSessionData"
        },
        "isSessionVmoUpdated": {
            "expression": {
                "$source": {
                    "$adapt": "updatedObjects"
                },
                "$query": {
                    "$source": "uid",
                    "$query": {
                        "$in": [
                            "{{ctx.userSession.uid}}"
                        ]
                    }
                }
            }
        }
    },
    "lifecycleHooks": {
        "render": "render",
        "onMount": "commonGlobalNavigationMountAction"
    },
    "_viewModelId": "CommonGlobalNavigation",
    "_uniqueViewModelId": "CommonGlobalNavigation",
    "ctx": {
        "user": {
            "type": "object"
        },
        "userSession": {
            "type": "object"
        },
        "tcSessionData": {
            "type": "object"
        }
    }
};




/*
define component
*/
const Component = createComponent( declViewModelJson, commonGlobalNavigationRenderFunction, undefined, ctxImportObj );

export default Component;
